            mid = left + (right - left)//2\n            if nums[mid] == target:\n                start = end = mid\n                # \u5de6\u53f3\u5b9a\u4f4d\u503c\u8303\u56f4\n                while start > 0 and nums[start] == nums[start - 1]:\n                    start -= 1\n                while end < n and nums[end] == nums[end + 1]:\n                    end += 1\n                return nums[:start + 1] + nums[end:]\n            elif nums[mid] < target:\n                left = mid + 1\n            else:\n                right = mid - 1\n        return nums\n")),(0,l.kt)("h3",{id:"86-\u5206\u9694\u94fe\u8868-\u4e2d\u7b49"},(0,l.kt)("a",{parentName:"h3",href:"https://leetcode.cn/problems/partition-list/"},"86. \u5206\u9694\u94fe\u8868")," \u4e2d\u7b49"),(0,l.kt)("pre",null,(0,l.kt)("code",{parentName:"pre",className:"language-py"},"# Definition for singly-linked list.\n# class ListNode:\n#     def __init__(self, val=0, next=None):\n#         self.val = val\n#         self.next = next\nclass Solution:\n    def partition(self, head: Optional[ListNode], x: int) -> Optional[ListNode]:\n        # O(n) O(1)\n        # \u521b\u5efa\u4e24\u4e2a\u5934\u7ed3\u70b9\uff0c\u7528\u4e8e\u5b58\u653e\u5c0f\u4e8e x \u7b49\u4e8e\u6216\u5927\u4e8e x \u7684\u8282\u70b9\n        dummy1 = ListNode()\n        dummy2 = ListNode()\n        \n        # \u521b\u5efa\u4e24\u4e2a\u6307\u9488\uff0c\u5206\u522b\u6307\u5411\u4e24\u4e2a\u865a\u62df\u5934\u7ed3\u70b9\n        smaller = dummy1\n        greater = dummy2\n        \n        cur = head\n        while cur:\n            if cur.val < x:\n                smaller.next = cur\n                smaller = smaller.next\n            else:\n                greater.next = cur\n                greater = greater.next\n                \n            cur = cur.next\n        # \u5c06\u5c0f\u4e8e x \u7684\u8282\u70b9\u90e8\u5206\u7684\u5c3e\u8282\u70b9\u8fde\u63a5\u5230\u5927\u4e8e\u6216\u7b49\u4e8e x \u7684\u8282\u70b9\u90e8\u5206\u7684\u5934\u8282\u70b9\